import React, { Component } from 'react';
import config from '../config';
import { Label } from 'semantic-ui-react'
class MenuHome extends Component {
    constructor(props) {
        super(props);
        this.state = {
            seller: ''
        }
    }

    async componentDidMount() {
        const seller = await config.methods.seller().call();
        this.setState({
            seller
        });
    }
    render() {
        return (
            <div className="main">
                <div>
                    <a class="ui blue image label"><img src="/images/avatar/small/veronika.jpg" />Veronika
    <div class="detail">Friend</div></a>
                </div>
                <h2>Seller: {this.state.seller}</h2>
            </div>
        );
    }
}

export default MenuHome;
